import React from 'react';


const DrumVisualizer = (props) => {
    return(
        <button>
            {
                props.playList === 'BANK 1'? 
                    props.firstPlayList.filter(x => x.key === props.keyPressed)[0].id : 
                    props.secondPlayList.filter(x => x.key === props.keyPressed)[0].id
            }
        </button>
    )
    
}


function areEqual (prevProps, nextProps)  {
    console.log(nextProps.key);
    console.log(prevProps.key);
    
    return nextProps.key === ''? false: true;
}


export default React.memo(DrumVisualizer, areEqual);
